  false,\n\t\"url\": null,\n\t\"notes\": \"The primary purpose of this project was
  to develop a consistent and accurate surface elevation dataset derived from high-accuracy
  Light Detection and Ranging (LiDAR) technology for the USGS San Francisco Coastal
  LiDAR project area. The LiDAR data were processed to a bare-earth digital terrain
  model (DTM). Detailed breaklines and bare-earth DEMs were produced for the project
  area. Data was formatted according to tiles with each tile covering an area of 1500
  m by 1500 m. A total of 712 tiles were produced for the project encompassing an
  area of approximately 610 sq. miles. This metadata relates to LAS that were classified
  in the following classes: Class 1 = Unclassified. This class includes vegetation,
  buildings, noise etc. Class 2 = Ground Class 7= Noise Class 9 = Water Class 10=
  Ignored Ground (due to proximity to breakline)\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
